import { useState } from "react";
import { Link, NavLink, Outlet } from "react-router-dom";
import "./App.css";
import ShiftMissionList from "./components/MissionAnswer/ShiftMissionList";
import Button from "./components/UI/Button";

const items = [
  { id: 1, name: "test" },
  { id: 2, name: "test" },
];

const shifts = [
  {
    id: 1,
    shift_date: "test",
    shift_dispatcher: "test"
  },
  {
    id: 2,
    shift_date: "test",
    shift_dispatcher: "test"
  }
]

function App() {

  return (
    <>
    <div className="flex flex-col py-6">
      <div className="inline-flex justify-center">
        <ul role="list" className="gap-4 w-3/4 lg:w-1/2">
          {shifts.map((shifts) => (
            <li
              key={shifts.id}
              className="bg-white shadow overflow-hidden rounded-md px-6 py-4 my-4"
            >
              {shifts.shift_date}
            </li>
          ))}
        </ul>
      </div>
      <div className="text-center">
      <Button>
        <NavLink to="create-mission">Créer une tournée</NavLink>
      </Button>
      </div>
    </div>
    </>
  );
}

export default App;
